DROP TABLE IF EXISTS `act_comment`;
CREATE TABLE `act_comment` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `task_id` varchar(60) DEFAULT NULL COMMENT '任务ID',
  `task_name` varchar(100) DEFAULT NULL COMMENT '任务名称',
  `task_def_key` varchar(100) DEFAULT NULL COMMENT '任务节点KEY',
  `pass` varchar(10) DEFAULT NULL COMMENT '决议类型',
  `pass_name` varchar(60) DEFAULT NULL COMMENT '决议名称',
  `task_create_date` datetime DEFAULT NULL COMMENT '任务开始时间',
  `task_end_date` datetime DEFAULT NULL COMMENT '任务结束时间',
  `proc_ins_id` varchar(60) DEFAULT NULL COMMENT '流程实例ID',
  `assignee` varchar(60) DEFAULT NULL COMMENT '审批人',
  `assignee_name` varchar(60) DEFAULT NULL COMMENT '审批人名称',
  `next_assignee` varchar(1000) DEFAULT NULL COMMENT '下一审批人',
  `next_assignee_name` varchar(1000) DEFAULT NULL COMMENT '下一审批人姓名',
  `msg` varchar(1000) DEFAULT NULL COMMENT '审批意见',
  `proc_def_key` varchar(100) DEFAULT NULL COMMENT '流程定义KEY',
  `proc_name` varchar(100) DEFAULT NULL COMMENT '流程名称',
  `organiser` varchar(60) DEFAULT NULL COMMENT '申请人/经办人',
  `organiser_name` varchar(60) DEFAULT NULL COMMENT '申请人/经办人名称',
  `business_id` varchar(60) DEFAULT NULL COMMENT '业务编号',
  `ip` varchar(100) DEFAULT NULL COMMENT '审批人IP',
  `channel` varchar(10) DEFAULT NULL COMMENT '审批渠道',
  `status` varchar(10) DEFAULT NULL COMMENT '状态',
  `field1` varchar(50) DEFAULT '0' COMMENT '是否为启动流程（是：1；否：0）',
  `field2` varchar(50) DEFAULT NULL COMMENT '集团编号',
  `field3` varchar(128) DEFAULT NULL COMMENT '公司编号',
  `field4` varchar(128) DEFAULT NULL COMMENT '部门或者组编号',
  `field5` varchar(256) DEFAULT NULL,
  `field6` varchar(255) DEFAULT NULL,
  `field7` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `act_comment_idx1` (`proc_ins_id`,`status`),
  KEY `act_comment_idx2` (`field1`,`proc_ins_id`,`status`)
) ENGINE=InnoDB AUTO_INCREMENT=3055 DEFAULT CHARSET=utf8 COMMENT='工作流审批意见表';

